import React ,{useState,useEffect } from "react";
import './App.css';
import Axios from "axios";


function App() {

  const [user, setUser] = useState([]);                                                     

  useEffect(()=>{
    Axios.get("http://localhost:8080/user").then(res=>{ setUser(res.data)}).catch(err=>console.log(err));
  },[]);


  return (
    <>
    <div className="container">
      <p >${user[0].name}</p>
    </div>
    </>
    );
}

export default App;
